    "You don't seem to have Flash installed. Get Flash to continue your verification.": "\u60a8\u4f3c\u4e4e\u5c1a\u672a\u5b89\u88dd Flash\u3002\u53d6\u5f97Flash\u4ee5\u7e7c\u7e8c\u60a8\u7684\u9a57\u8b49\u3002",
